import React,{useState} from 'react'
import './register.css'

export default function Register() {
    const [email,setEmail] = useState("")
    const [password,setPassword] = useState("")
    const [reEnterPassword,setRePassword] = useState("")

    const collectData=()=>
    {
      console.warn(email,password,reEnterPassword)
    }

  return (
    <div className='registerPage'>
        <h1>Crack Your Goal with India's top educator</h1>
        <input className='inputBox' type='text' placeholder='Enter your Email' value={email} onChange={(e)=>setEmail(e.target.value)}/><br></br>

        <input className='inputBox' type='text' placeholder='Enter Password' value={password} onChange={(e)=>setPassword(e.target.value)}/><br></br>

        <input className='inputBox' type='text' placeholder='Re-enter password' value={reEnterPassword} onChange={(e)=>setRePassword(e.target.value)}/><br></br>

        <button onClick={collectData} type='button'>Sign up</button>
    </div>
  )
}
